CREATE TABLE IF NOT EXISTS "flights" (
    "row_id" INT,
    "id" TEXT,
    "valid_until" TEXT,
    "leg_id" TEXT,
    "route_id" TEXT,
    "route_from_id" TEXT,
    "route_from_name" TEXT,
    "route_to_id" TEXT,
    "route_to_name" TEXT,
    "route_distance" BIGINT,
    "provider_id" TEXT,
    "provider_price" NUMERIC(9, 2),
    "provider_flight_start" TEXT,
    "provider_flight_end" TEXT,
    "provider_company_id" TEXT,
    "provider_company_name" TEXT
);
ON CONFLICT (row_id)
DO UPDATE SET row_id = excluded.row_id,
              "id" = excluded."id",
              "valid_until" = excluded."valid_until",
              "leg_id" = excluded."leg_id",
              "route_id"=excluded."route_id",
              "route_from_id"=excluded."route_from_id",
              "route_from_name" = excluded."route_from_name",
              "route_to_id"=excluded."route_to_id",
              "route_to_name"=excluded."route_to_name",
              "route_distance"=excluded."route_distance",
              "provider_id"=excluded."provider_id",
              "provider_price"=excluded."provider_price",
              "provider_flight_start"=excluded."provider_flight_start",
              "provider_flight_end"=excluded."provider_flight_end",
              "provider_company_id"=excluded."provider_company_id",
              "provider_company_name"=excluded."provider_company_name";